//Components
import Header from "./Components/Header/Header";
import Button from "./Components/Buttons/Button";
import Footer from "./Components/Footer/Footer";

//Styles
import './App.scss';

//Interfaces
import { AppInterface } from './AppInterfaces';

//Images
const whatsAppIcon : string = require("./Images/whatsApp_icon.svg").default;
const phoneIcon : string = require("./Images/phone_icon.svg").default;
const emailIcon : string = require("./Images/email_icon.svg").default;

//Component
const App : React.FC<AppInterface> = (props : AppInterface) => {
	return (
		<div className="App">
			<Router>
				<Header>
					<Button data={{
						customClass: "headerNav",
						itemCopy: "What we do",
						itemIcon: "",
						itemType: "internalLink",
						itemHref: "/what-we-do/",
						itemFunction: () => { }
					}} />

					<Button data={{
						customClass: "headerNav",
						itemCopy: "Who we are",
						itemIcon: "",
						itemType: "internalLink",
						itemHref: "/who-we-are/",
						itemFunction: () => { }
					}} />

					<Button data={{
						customClass: "headerNav",
						itemCopy: "How can we help?",
						itemIcon: "",
						itemType: "internalLink",
						itemHref: "/how-can-we-help/",
						itemFunction: () => { }
					}} />
				</Header>

				{/* <main>
					<Routes>
						<Route path="/" exact element={
							<HomePage pageData={{}} />
						} />

						<Route path="/what-we-do/" element={
							<WhatWeDoPage pageData={{}} />
						} />

						<Route path="/who-we-are/" element={
							<WhoWeArePage pageData={{}} />
						} />

						<Route path="/how-can-we-help/" element={
							<HowCanWeHelpPage pageData={{}} />
						} />
					</Routes>
				</main> */}

				<Footer>
					<Button data={{
						customClass: "footerNav",
						itemCopy: "Whatsapp",
						itemIcon: whatsAppIcon,
						itemType: "externalLink",
						itemHref: "https://google.com/",
						itemFunction: () => {}
					}} />

					<Button data={{
						customClass: "footerNav",
						itemCopy: "Phone",
						itemIcon: phoneIcon,
						itemType: "externalLink",
						itemHref: "#",
						itemFunction: () => {}
					}} />

					<Button data={{
						customClass: "footerNav",
						itemCopy: "Email",
						itemIcon: emailIcon,
						itemType: "externalLink",
						itemHref: "#",
						itemFunction: () => {}
					}} />
				</Footer>
			</Router>
		</div>
	);
};

export default App;
